import * as React from "react";
import PropTypes from "prop-types";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import CardActionArea from "@mui/material/CardActionArea";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Divider from "@mui/material/Divider";
import Box from "@mui/material/Box";
import CHSLogo90 from "../assets/images/CHSLOGO90.jpg";
import pbm from "../assets/images/pbm.jpg";

import { useTheme, ThemeProvider, createTheme } from "@mui/material/styles";

function FeaturedPost() {
  const theme = useTheme();

  return (
    <Box
      sx={{
        width: "90%",
        position: "relative",
        p: { xs: 3, md: 6 },
      }}
    >
      <Typography component="h1" variant="h4" color="inherit" gutterBottom>
        Here are some of my most recent projects:
      </Typography>

      <Grid container spacing={4}>
        <Grid item xs={12} md={6}>
          <CardActionArea
            component="a"
            target="_blank"
            href="https://www.curtishomesolutions.com/"
          >
            <Card sx={{ display: "flex" }}>
              <CardContent sx={{ flex: 1 }}>
                <Typography component="h2" variant="h5">
                  Curtis Home Solutions
                </Typography>
                {/* <Typography variant="subtitle1" color="text.secondary">
                  Post Date
                </Typography> */}
                <Divider />
                <Typography variant="subtitle" paragraph>
                  New business startup. Website, CRM, Email, invoicing.
                </Typography>
                <Typography variant="subtitle1" color="Inherit">
                  Tap to see the final product
                </Typography>
              </CardContent>
              <CardMedia
                component="img"
                sx={{
                  width: 160,
                  // display: { sm: "block" },
                }}
                image={CHSLogo90}
                alt="Filler text"
              />
            </Card>
          </CardActionArea>
        </Grid>
        <Grid item xs={12} md={6}>
          <CardActionArea
            component="a"
            target="_blank"
            href="https://www.photosbymalaina.com/"
          >
            <Card sx={{ display: "flex" }}>
              <CardContent sx={{ flex: 1 }}>
                <Typography component="h2" variant="h5">
                  Photos by Malaina
                </Typography>
                {/* <Typography variant="subtitle1" color="text.secondary">
                  Post Date
                </Typography> */}
                <Divider />
                <Typography variant="subtitle" paragraph>
                  Photography Portfolio. Website, Email.
                </Typography>
                <Typography variant="subtitle1" color="Inherit">
                  Tap to see the final product
                </Typography>
              </CardContent>
              <CardMedia
                component="img"
                sx={{ width: 160, display: { sm: "block" } }}
                image={pbm}
                alt="Filler text"
              />
            </Card>
          </CardActionArea>
        </Grid>
      </Grid>
    </Box>
  );
}

export default FeaturedPost;
